import Box from "@mui/material/Box";
import Video from "../Video/Video";
import Chatter from "../Chatter/Chatter";
import { SxProps } from "@mui/system";
import Navbar from "./Navbar";

function Layout(): JSX.Element {
  return (
    <Box sx={gridContainer}>
      <Navbar></Navbar>
      <Box sx={videoContainer}>
        <Video></Video>
      </Box>
      <Box sx={chatContainer}>
        <Chatter></Chatter>
      </Box>
    </Box>
  );
}

const border: SxProps = {
  borderRadius: "2px",
  border: "1px solid",
};

const gridContainer: SxProps = {
  display: "inline-grid",
  columnGap: 1,
  gridTempateColumns: "3fr 1fr",
  gridTemplateAreas: `
		"video video video chat"
		"video video video chat"
		"video video video chat"
	`,
};

const chatContainer: SxProps = {
  gridArea: "chat",
  width: "29vw",
  height: "calc(100vh - 2px)",
  ...border,
};

const videoContainer: SxProps = {
  gridArea: "video",
  width: "70vw",
  height: "calc(100vh - 2px)",
  ...border,
};

const miscContainer: SxProps = {
  gridArea: "misc",
  width: "28vw",
  height: "29vh",
  ...border,
};

export default Layout;
